	return (
		<div className='col-3'>
			<div className='card-wrapper'>
				<div className='card'>
					<h5 className='card-header'>Name: {warehouse.name}</h5>
					<div className='warning'></div>
					<div className='card-body'>
						<h5 className='card-title'>Item count: {warehouse.itemCount}</h5>
						<p className='card-text'>Address: {props.address}</p>
						<Link to='#' className='btn btn-primary'>
							Go to warehouse
						</Link>
					</div>
				</div>
			</div>
		</div>
	);
}
